import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [titles, setTitles] = useState([]);

  useEffect(() => {
    let titles = [];
    const key = '85062f74bccf4b33872bf17c11caaae6';
    const url = `https://newsapi.org/v2/everything?q=tesla&from=2021-10-20&sortBy=publishedAt&apiKey=${key}`;

    fetch(url)
      .then((response) => response.json())
      .then((response) => {
        console.log(response.articles);
        titles.push(response.articles.title);
      });

    setTitles(titles);
  }, []);

  var listOfTitles = titles.map((t) => {
    return <li>{t}</li>;
  });

  return (
    <div className='App'>
      <h1>Hey</h1>
      <ul>{listOfTitles}</ul>
    </div>
  );
}

export default App;
